import Mohan from "../src/Assets/Images/Mohan-muruge.jpg";
import Logo from "../src/Assets/Logo/Logo-brainflix.svg";

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src={Logo} />
      <input className="header__search" placeholder="Search..." />
      <div className="header__right">
        <button className="header__right--upload" type="button" name="upload">
          + UPLOAD
        </button>
        <img className="header__right--Mohan" src={Mohan} />
      </div>
    </header>
  );
}

export default App;
